import Navbar from 'react-bootstrap/Navbar';
import Image from 'next/Image';

const NavBar = () => {
  return (
    <Navbar bg="light">
      <Navbar.Brand href="/">
        <Image
          src="/logo.png"
          width="200"
          height="40"
          className="d-inline-block align-top"
          alt="YQMF logo"
        />
      </Navbar.Brand>
      <Nav className="mr-auto">
        <Nav.Link href="/">Home</Nav.Link>
      </Nav>
    </Navbar>
  );
};

export default NavBar;
